import React from 'react';
import Container from 'react-bootstrap/Container';
import Carousel from 'react-bootstrap/Carousel';
import Placeholder from 'react-bootstrap/Placeholder';
import Image from 'react-bootstrap/Image';

export const VehicleDetails = () => {
    return (
    <Container className='text-center'>

        <Carousel fade>
      <Carousel.Item>
      <Image   className="d-block w-100"  variant="top" src="https://placehold.co/600x400?text=Vehicle+Image" />

      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://mdbcdn.b-cdn.net/img/Photos/Slides/img%20(121).webp"
          alt="Second slide"
        />
      </Carousel.Item>
      <Carousel.Item>
        <img
          className="d-block w-100"
          src="https://mdbcdn.b-cdn.net/img/Photos/Slides/img%20(31).webp"
          alt="Third slide"
        />
      </Carousel.Item>
    </Carousel>


        <Container className='text-start'>
    
        </Container>
    </Container>
    );
  }
  
  export default VehicleDetails;
